import React from 'react';
import './Botnav.css';
import BotnavItem from './BotnavItem/BotnavItem';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope } from '@fortawesome/free-solid-svg-icons';
import {
    faFacebookF,
    faGithub,
    faFacebookMessenger,
    faLinkedin
} from '@fortawesome/free-brands-svg-icons';

const Botnav = () => {
    return (
        <header className='botnav'>
            <nav className='botnav__nav'>
                <div className='botnav__nav-spacer'></div>
                <div className='botnav__nav-links'>
                    <div className='botnav__nav-icon'>
                    <a href="https://www.facebook.com/filipzakrocki77">
                        <FontAwesomeIcon icon={faFacebookF}/>
                    </a>
                    </div>
                    <div className='botnav__nav-icon'>
                    <a href="https://github.com/filipzakrocki">
                    <FontAwesomeIcon icon={faGithub}/>
                    </a>
                    </div>
                    <div className='botnav__nav-icon'>
                    <a href="https://www.linkedin.com/in/filip-zakrocki-08b561190/">
                    <FontAwesomeIcon icon={faLinkedin}/>
                    </a>
                    </div>
                    <div className='botnav__nav-icon'>
                    <a href="mailto:zakrofil@gmail.com">
                    <FontAwesomeIcon icon={faEnvelope}/>
                    </a>
                    </div>
                    <div className='botnav__nav-icon'>
                    <a href="http://m.me/filipzakrocki77">
                    <FontAwesomeIcon icon={faFacebookMessenger}/>
                    </a>
                    </div>

                    <BotnavItem 
                    icon={'facebook'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    <BotnavItem 
                    icon={'github'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    <BotnavItem 
                    icon={'facebook'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    <BotnavItem 
                    icon={'facebook'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    <BotnavItem 
                    icon={'facebook'}
                    url={"https://github.com/filipzakrocki"}
                    />
                    
                    
                    
                </div>
                <div className='botnav__nav-spacer'></div>
            </nav>
        </header>
        
    );
}

export default Botnav;
